import React from 'react';
import { BiHome } from "react-icons/bi";
import { Nav, Navbar } from 'react-bootstrap';
import MUIDataTable from "mui-datatables";


function PartnerUserSeach(){

    const id = localStorage.getItem("user_id");
    const token = localStorage.getItem("token");
    const [msg, Setmsg] = useState("");
    const [AllowUser, SetAllowUser] = useState(false);

    const nav = useNavigate();

    const Exit = () => {
        localStorage.clear()
        sessionStorage.clear()
        nav("../Login/PartnerLogin")
    }

    useEffect(() => {

        var decoded = jwt_decode(token);

        if (id == "" || token == "" || id == undefined || token == undefined) {
            nav("../Login/PartnerLogin")
        } else {
            if (decoded.id == id) {
                SetAllowUser(true)
                Axios.post("http://localhost:3001/LoginCheckPartner", {
                    user_id: id
                }).then((response) => {
                    Setmsg(response.data);
                });
            } else {
                SetAllowUser(false)
                localStorage.clear()
                sessionStorage.clear()
                nav("../Login/PartnerLogin")
            }
        }
    }, [])



    const columns = [
        {
         name: "name",
         label: "Name",
         options: {
          filter: true,
          sort: true,
         }
        },
        {
         name: "company",
         label: "Company",
         options: {
          filter: true,
          sort: false,
         }
        },
        {
         name: "city",
         label: "City",
         options: {
          filter: true,
          sort: false,
         }
        },
        {
         name: "status",
         label: "Status",
         options: {
          filter: true,
          sort: false,
         }
        },
       ];
       
       const data = [
        { name: "Joe James", company: "Test Corp", city: "Yonkers", status: <h1>NY</h1> },
        { name: "John Walsh", company: "Test Corp", city: "Hartford", status: "CT" },
        { name: "Bob Herm", company: "Test Corp", city: "Tampa", status: "FL" },    
        { name: "James Houston", company: "Test Corp", city: "Dallas", status: "TX" },
       ];
       
       const options = {
         filterType: 'checkbox',
       };

    return(
        <div>
        {AllowUser}
            <Navbar bg="dark" variant="dark">
                <Nav.Link href="./Partner">
                    <div className="image_icon_nav">
                        <BiHome />
                    </div>
                </Nav.Link>
                <Nav className="me-auto">
                    <Nav.Link href="./PartnerJobAd">Job Ad</Nav.Link>
                    <Nav.Link href="./PartnerUserSearch">Search user</Nav.Link>
                    <Nav.Link href="./PartnerStats">Statics</Nav.Link>
                </Nav>
                <Navbar.Collapse className="justify-content-end">
                    <NavDropdown title={"Sign in as : " + msg} id="basic-nav-dropdown">
                        <NavDropdown.Item href="./PartnerProfile">Edit profile</NavDropdown.Item>
                        <NavDropdown.Divider />
                        <NavDropdown.Item onClick={Exit}>Log Out</NavDropdown.Item>
                    </NavDropdown>
                </Navbar.Collapse>
            </Navbar>
        <div>
                
            <MUIDataTable
  title={<h2>Application List</h2>}
  data={data}
  columns={columns}
  options={options}
/>

        </div>
    </div>
    );
}

  
export default PartnerUserSeach;
